import React, { Component } from "react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";
import AppBar from "@material-ui/core/AppBar";
import Button from "@material-ui/core/Button";
import Toolbar from "@material-ui/core/Toolbar";
import { login, logout } from "../home/ducks/Login";

class NavBar extends Component {
  handleLogin = () => {
    this.props.login("tester", "pass", this.props.history);
  };
  handleLogout = () => {
    this.props.logout(this.props.history);
  };
  render() {
    return (
      <AppBar position="static">
        <Toolbar>
          <Button variant="contained" onClick={this.handleLogin}>
            Admin Login
          </Button>
          <Button color="inherit">Login</Button>{" "}
          <Button variant="contained" onClick={this.handleLogout}>
            Logout
          </Button>
        </Toolbar>
      </AppBar>
    );
  }
}
const mapStateToProps = (state) => {
  console.log(state.loginState);
  // console.log(state.registerState);
  return {
    loggingIn: state.loginState.loggingIn,
    loggedIn: state.loginState.loggedIn,
    logout: state.loginState.logout,
    //   registered: state.registerState.registered,
    user: state.loginState.user,
    error: state.loginState.error,
  };
};

const mapDispatchToProps = {
  login,
  logout,
};

export default withRouter(connect(mapStateToProps, mapDispatchToProps)(NavBar));
